        "date": "Monday, September 4",
        "day_num_UI": 1,
        "description": "<p>We left the house in the morning. The car was filled with leftovers from the party. <i>We frantically wrote a thank you note to Jackson\u2019s parents before we left.-CH</i> At a gas station in SF, Jackson tried to put water in the tires. <i>We stop and try to figure out who is driving next. I say, \u201cwhoever is most assertive.\u201d When I get to the driver\u2019s seat Steven is already sitting there.-AS</i>  We drove up highway 1 along the coast; everything was on fire. Sign on road: \u201cLet\u2019s protect both elk and cow - build elk fences now!\u201d Everybody kept passing Conor cause the roads were so winding.</p><div class=\"paraspacer\"></div><p>We listened to Shark Saddle. <i>I like Pumpkin Bread better.-JC</i> Aidan agrees. <i>I\u2019m surprised Shark Saddle is actually pretty good cause it wasn\u2019t very fun.-AS</i></p><div class=\"paraspacer\"></div><p>Confusion Hill</p><p class=\"indented\">\t-\u201cI\u2019m confused\u201d</p><p class=\"indented\">\t-<i>I think we\u2019re gonna start seeing a lot of this kind of stuff.-JC</i></p><div class=\"paraspacer\"></div><p>\u201cCatch the crow\u201d</p><div class=\"paraspacer\"></div><p>\u201cSweet Cron\u201d</p><div class=\"paraspacer\"></div><p>Tried to find a campground; got lost in sinkyone wilderness area somewhere between road A and road B. \u201cManatee in the Mailbox.\u201d</p><div class=\"paraspacer\"></div><p><a href=#day=1&index=16>\u201cThorn Junction\u201d</a></p><div class=\"paraspacer\"></div><p><i>Camped that night, after driving to black sand beach. Set up tent in the dark. Steven was right about where to camp, and we decided Steven was always right. Jackson was right about how to set up the tent. We were all wearing flannels except for Aidan, who I think teased us for all wearing flannels. I ate the leftover pasta with my pocket knife blade. Tried to rehearse for our gig by <a href=#day=1&index=20>singing in the dark</a>. We were really tired.</i></p><div class=\"paraspacer\"></div><p><i>We didn\u2019t have our bear canisters. We didn\u2019t get eaten. We learned not to trust Jackson. It was a good night. -AS</i></p><div class=\"paraspacer\"></div><p>We hypothesized that even though we didn\u2019t see any bears, they were probably encircling our picnic table as we ate dinner and were waiting in the darkness to eat the rest of our food (or us). </p>",
