        "date": "Tuesday, September 5",
        "day_num_UI": 2,
        "description": "<p>We woke at 7 to pack up the tent; then spent 10 hours in the car. In the car, we made a setlist for our Portland show. We were also trying to wrangle a keyboard in Portland and ended up retrieving one from Ben Blechman.</p><p>\u201cWar horse jackson\u201d</p><p>We stopped at a deli and everything was ashy. And so hot.</p><div class=\"paraspacer\"></div><p>Captions for <a href=#day=2&index=3>Steven\u2019s smolder photo</a>:</p><p class=\"indented\">-\u201cWho wants to learn a little sumthin about Washington?\u201d</p><p class=\"indented\">-\u201cHowdy Folks!\u201d</p><p class=\"indented\">-\u201cAnd on your left, a cool camouflage hat.\u201d</p><p class=\"indented\">-\u201cLook ma, two hands!\u201d</p><p class=\"indented\">-\u201cWelcome to the historic spot where we found Aidan\u2019s camouflage hat\u201d</p><p class=\"indented\">-\u201cI have a map!\u201d</p><p class=\"indented\">-\u201cWh wh wh why do you wanna eat me?\u201d</p><div class=\"paraspacer\"></div><p>We played our house show in Portland! \u00a0This was our ad for the gig:</p><p class=\"indented\">\u201cPSA to Portland folks! Or other folks who have friends who are Portland folks! Pumpkin Bread is playing a show near you tonight! We're going to get highly caffeinated at some Portland coffee roasters and play lots of good notes (get it?) for you. Come on out!\u201d</p><div class=\"paraspacer\"></div><p>\u201cFuck you and your goddamn gingerbread house music!\u201d -Dave</p><div class=\"paraspacer\"></div><p>Ronnie showed us his record collection twice. He also kept getting us beers. Most of the crowd at the show were Nike employees. Confusing political demographic? We learned we can\u2019t play the nap tune without Maura.</p><div class=\"paraspacer\"></div><p><i>The roads were windy, the air was hazy and smelled strongly of fire. Someone at the grocery store said \u201cthe whole state is burning down.\u201d I have trouble distinguishing Oregon and New Hampshire. There\u2019s a big fire in a gorge because a kid threw a firecracker in there. How have I not heard about this? We stopped to look at big trees. Conor found me a camouflage hat on the ground. We saw many cows and sheep and passed though part of elk territory- no elk, sadly. Not yet anyway\u2026 -AS</i></p><div class=\"paraspacer\"></div><p>Carol was trying to show us art and ronnie kept interrupting. She kept repeating: \u201cDon\u2019t care about impressing anyone or yourself,\u201d and \u201cDon\u2019t try to create a perfect work.\u201d</p><div class=\"paraspacer\"></div><p><i>Fun night of stage banter. My first joke about the Nap Tune: \u201cif you fall asleep, it\u2019s only five minutes so we\u2019ll wake you up after. Made a dumb, vaguely political speech. Made joke at the end, if anyone forgot Shine on Through lyrics, we would stop playing. People forgot; we stopped playing. A guy told me I was a natural comedian-I\u2019ve never heard that before; it was a weird night -AS</i></p><div class=\"paraspacer\"></div><p><i>I was in full extrovert mode after house concert. Conversation with a couple about how hard it is being American when you\u2019re in a different country. I think they got a different meaning from our song. -CH</i></p>",
